import React from 'react';
import MonthlyChart from '~/pages/chart.js';

const data = [
    { month: 'Jan', usage: 10, amount: 67000 },
    { month: 'Feb', usage: 12, amount: 80400 },
    { month: 'Mar', usage: 20, amount: 134000 },
    { month: 'Apr', usage: 30, amount: 201000 },
    { month: 'May', usage: 5, amount: 33500 },
    { month: 'Jun', usage: 15, amount: 100500 },
];

const App = () => {
    return (
        <div>
            <h1>Monthly Water Consumption and Bill</h1>
            <MonthlyChart data={data} />
        </div>
    );
};

export default App;
